import React from 'react';

const ListGroup = (props) => {
    const { genres, textProperty, valueProperty } = props;

    return (
        <div>
            <ul className="list-group">
                { genres.map(genre => (
                    <li  key={genre}
                         className="list-group-item">
                        { genre.name }
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ListGroup;
